import{_ as e,o as t,c as r,O as i}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 3.2-1710 Persons eligible to vote.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-1710.md","filePath":"vacode/3.2-1710.md"}'),a={name:"vacode/3.2-1710.md"},o=i('<h1 id="§-3-2-1710-persons-eligible-to-vote" tabindex="-1">§ 3.2-1710 Persons eligible to vote. <a class="header-anchor" href="#§-3-2-1710-persons-eligible-to-vote" aria-label="Permalink to &quot;§ 3.2-1710 Persons eligible to vote.&quot;">​</a></h1><p>Each member of the horse industry who has paid for the administering of the equine infectious anemia test during the previous fiscal year shall be eligible to vote in a referenda, provided that he certifies on forms approved by the Board that he has paid for such a test. Any person meeting such requirements shall be eligible to vote in the referendum, but no person shall be required to be a qualified voter in other respects. Any person who is not an individual shall vote by its authorized representative.</p><p>2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0497" target="_blank" rel="noreferrer">497</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>, § 3.1-22.65; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',3),n=[o];function s(l,h,c,d,p,_){return t(),r("div",null,n)}const v=e(a,[["render",s]]);export{g as __pageData,v as default};
